import React, { useContext, useState } from 'react';
import { alpha, styled } from '@mui/material/styles';
import {
  AppBar,
  Box,
  Toolbar,
  Button,
  IconButton,
  Container,
  Divider,
  MenuItem,
  Drawer,
  Typography,
  Avatar,
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import CloseRoundedIcon from '@mui/icons-material/CloseRounded';
import { SettingsContext } from '../context/SettingsContext';
import ThemeSwitch from './ThemeSwitch';
import LanguageSwitchComponent from './LanguageSwitch'; // 引入语言切换组件

const StyledToolbar = styled(Toolbar)(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'space-between',
  flexShrink: 0,
  borderRadius: `calc(${theme.shape.borderRadius}px + 8px)`,
  backdropFilter: 'blur(24px)',
  border: '1px solid',
  borderColor: (theme.vars || theme).palette.divider,
  backgroundColor: theme.vars
    ? `rgba(${theme.vars.palette.background.defaultChannel} / 0.4)`
    : alpha(theme.palette.background.default, 0.4),
  boxShadow: (theme.vars || theme).shadows[1],
  padding: '8px 12px',
}));

export default function CustomAppBar() {
  const [open, setOpen] = useState(false);

  const toggleDrawer = (newOpen) => () => {
    setOpen(newOpen);
  };

  return (
    <AppBar
      position="fixed"
      enableColorOnDark
      sx={{
        boxShadow: 0,
        bgcolor: 'transparent',
        backgroundImage: 'none',
        mt: 'calc(var(--template-frame-height, 0px) + 28px)',
      }}
    >
      <Container maxWidth="lg">
        <StyledToolbar variant="dense" disableGutters>
          {/* 圆形头像 */}
          <Box sx={{ flexGrow: 1, display: 'flex', alignItems: 'center', px: 0 }}>
          <Avatar
            src="../assets/img/steven_cartoon.JPG"
            alt="Steven Logo"
            sx={{
              width: 30,
              height: 30,
              mr: 1,
              overflow: 'hidden', // 确保溢出的部分被隐藏
              backgroundSize: 'contain', // 背景图片调整为按比例缩放
              backgroundPosition: 'center',
              backgroundRepeat: 'no-repeat',
              backgroundImage: `url('../assets/img/steven_cartoon.JPG')`, // 替换图片的加载方式
            }}
          />

            <Box sx={{ display: { xs: 'none', md: 'flex'} }}>
              <Button variant="text" color="info" size="small">
                Home
              </Button>
              <Button variant="text" color="info" size="small">
                Blogs
              </Button>
              <Button variant="text" color="info" size="small">
                Projects
              </Button>
              <Button variant="text" color="info" size="small">
                Finance
              </Button>
              <Button variant="text" color="info" size="small">
                Profile
              </Button>
            </Box>
          </Box>

          {/* 右侧按钮 */}
          <Box
            sx={{
              display: { xs: 'none', md: 'flex' },
              gap: 0,
              alignItems: 'center',
            }}
          >
            <LanguageSwitchComponent /> {/* 使用语言切换组件 */}
            <ThemeSwitch /> {/* 使用主题切换组件 */}
          </Box>
          <Box
            sx={{
              display: { xs: 'none', md: 'flex' },
              gap: 1.5,
              alignItems: 'center',
            }}
          >
            <Button color="primary" variant="outlined" size="small">
              Log in
            </Button>
            <Button color="primary" variant="contained" size="small">
              Sign up
            </Button>
          </Box>

          {/* 移动端菜单 */}
          <Box sx={{ display: { xs: 'flex', md: 'none' }, gap: 1 }}>
            <IconButton aria-label="Menu button" onClick={toggleDrawer(true)}>
              <MenuIcon />
            </IconButton>
            <Drawer
              anchor="top"
              open={open}
              onClose={toggleDrawer(false)}
              PaperProps={{
                sx: {
                  top: 'var(--template-frame-height, 0px)',
                },
              }}
            >
              <Box sx={{ p: 2, backgroundColor: 'background.default' }}>
                <Box
                  sx={{
                    display: 'flex',
                    justifyContent: 'flex-end',
                  }}
                >
                  <IconButton onClick={toggleDrawer(false)}>
                    <CloseRoundedIcon />
                  </IconButton>
                </Box>
                <MenuItem>Home</MenuItem>
                <MenuItem>Blogs</MenuItem>
                <MenuItem>Projects</MenuItem>
                <MenuItem>Finance</MenuItem>
                <MenuItem>Profile</MenuItem>
                <Divider sx={{ my: 3 }} />
                <MenuItem>
                  <LanguageSwitchComponent /> {/* 在移动端菜单中使用语言切换组件 */}
                </MenuItem>
                <MenuItem>
                  <ThemeSwitch /> {/* 在移动端菜单中使用主题切换组件 */}
                </MenuItem>
                <Divider sx={{ my: 3 }} />
                <MenuItem>
                  <Button color="primary" variant="contained" fullWidth>
                    Sign up
                  </Button>
                </MenuItem>
                <MenuItem>
                  <Button color="primary" variant="outlined" fullWidth>
                    Sign in
                  </Button>
                </MenuItem>
              </Box>
            </Drawer>
          </Box>
        </StyledToolbar>
      </Container>
    </AppBar>
  );
}
